import React from 'react';
import { Card } from 'antd';
import 'antd/dist/antd.css';

const { Meta } = Card;

function TypeCard() {

    return (
        <div>

            <a href="">
            <Card
                hoverable
                style={{ width: 240 }}
                cover={<img className="typeCard" alt="example" src="data:image/png;base64," />}
            >
                <Meta title="Turtle" description="Number of Projects: 5" />
            </Card>
            </a>

        </div>
    )

}
export default TypeCard;
